import React from 'react';
import '../styles/LabStyle/PracticalWork1.css'; 

const PracticalWork1 = () => {
  // Sample schedule data
  const scheduleData = [
    { period: '1', Monday: 'Math', Tuesday: 'Physics', Wednesday: 'Programming', Thursday: 'InfoTech', Friday: 'Math', Saturday: 'Free', Sunday: 'Free' },
    { period: '2', Monday: 'Physics', Tuesday: 'Math', Wednesday: 'InfoTech', Thursday: 'Programming', Friday: 'Physics', Saturday: 'Free', Sunday: 'Free' },
    // Add more periods as needed
  ];

  const days = ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday', 'Sunday'];

  return (
    <div className="schedule-container">
      <h3 className="schedule-title">Практична робота 1</h3>
      <table className="schedule-table">
        <thead>
          <tr>
            <th>Period</th>
            {days.map((day, index) => (
              <th key={index}>{day}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {scheduleData.map((row, rowIndex) => (
            <tr key={rowIndex}>
              <td>{row.period}</td>
              {days.map((day, dayIndex) => (
                <td key={dayIndex}>{row[day]}</td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default PracticalWork1;
